import Head from "next/head";
import Haad from "next/head";
import Navbar from "./Navbar"

const Layout  = (props) => (
    <div>
        <Head>
            <title>BitzPrice</title>
        </Head>
        <Navbar/>
        {props.children}
    </div>
);

export default Layout;
